window.bookSummaryJSON = "<p>A life for a life … will kill the both of us in the end.</p> <p>Clover</p> <p>I know nothing of the Sickness at Eastpoint University. I know only the backroads that slip past the southern beaches and the gators that make their way onto the swamp's shores. Until him. Until the killer known as Braxton Smalls finds his way into my stilted trailer on the coast of Port Charlotte.</p> <p>He came looking for Ace, but he found me instead…</p> <p>Braxton</p> <p>I’m a monster. Always have been. Always will be. The only people I’ve ever cared about are my boys and their girls. No one hurts my family, and knowing that someone has … and that they’ve gotten away with it plagues me.</p> <p>Ace Volkov will pay for what he put Avalon through and if I have to use his most precious weakness to draw him out, I will.</p> <p>She thinks she can bargain for his life with her own, but I mean to show her that there’s nothing I won’t do to see my vengeance through to the end.</p> <p>***This is a Dark MF Enemies to Lovers College Romance.***</p> <p>***Please Note: This book is labeled as \"Dark\" for a reason. If you are sensitive or easily triggered by subjects and actions that are common in \"dark\" romance, please take that into consideration and enjoy responsibly.***</p>"; 
